import React, { useState } from "react";
import {
  MDBContainer,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarToggler,
  MDBIcon,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBDropdown,
  MDBDropdownToggle,
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBDropdownLink,
  MDBCollapse,
} from "mdb-react-ui-kit";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import Logo from "../../NavbarBrand.png";
import AuthServices from "../../auth.service";
import { PersonCircle } from "react-bootstrap-icons";

import { NavLink } from "react-router-dom";

export default function Navigation() {
  const [showBasic, setShowBasic] = useState(false);
  const username = localStorage.getItem("username");
  const company = localStorage.getItem("company");

  console.log(username);

  const logout = () => {
    localStorage.removeItem("username");
    localStorage.removeItem("company");
    localStorage.removeItem("refresh_token");
    localStorage.removeItem("access_token");
    alert("Sie werden ausgeloggt.");
    window.location.reload(false);
  };

  function routerLink() {}

  return (
    <div>
      <MDBNavbar expand="lg" dark bgColor="dark">
        <MDBContainer fluid>
          <MDBNavbarBrand href="https://youtu.be/dQw4w9WgXcQ?autoplay=1">
            <img src={Logo} height="30" />
          </MDBNavbarBrand>

          <MDBNavbarToggler
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
            onClick={() => setShowBasic(!showBasic)}
          >
            <MDBIcon icon="bars" fas />
          </MDBNavbarToggler>

          <MDBCollapse navbar show={showBasic}>
            <MDBNavbarNav className="mr-auto mb-2 mb-lg-0">
              <MDBNavbarItem className="mt-2 mx-3">
                <NavLink to="/dashboard">Dashboard</NavLink>
              </MDBNavbarItem>
              <MDBNavbarItem className="mt-2 me-3">
                <NavLink to="/transactions">Auftr√§ge</NavLink>
              </MDBNavbarItem>

              <MDBNavbarItem className="mt-2 me-3">
                <NavLink to="/partners">Partner</NavLink>
              </MDBNavbarItem>

              <MDBNavbarItem className="mt-2 me-3">
                <NavLink to="/settings">Einstellungen</NavLink>
              </MDBNavbarItem>

              <MDBNavbarItem className=".ms-auto">
                <MDBDropdown>
                  <MDBDropdownToggle tag="a" className="nav-link">
                    {username + " " + company + " "}
                    <MDBIcon
                      size="lg"
                      className="ms-1"
                      far
                      icon="user-circle"
                    />
                  </MDBDropdownToggle>
                  <MDBDropdownMenu>
                    <MDBDropdownItem>
                      <MDBDropdownLink onClick={logout}>Logout</MDBDropdownLink>
                    </MDBDropdownItem>
                    <MDBDropdownItem>
                      <MDBDropdownLink>Account</MDBDropdownLink>
                    </MDBDropdownItem>
                  </MDBDropdownMenu>
                </MDBDropdown>
              </MDBNavbarItem>
            </MDBNavbarNav>
          </MDBCollapse>
        </MDBContainer>
      </MDBNavbar>
      <br />
    </div>
  );
}
